import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Person from "./Pages/Person/Person";
 const mapRoutes = {
    "clue1" : <Clue1 /> ,
    "jiya": <Person textFileName={'jiya'} personName={'Jiya'} />,

    "clue2" : <Clue2 />, 
    "saloni": <Person2 textFileName={'saloni'} personName={'Saloni'} />,

    "clue3" : <Clue3 />, 
    "krish": <Person3 textFileName={'krish'} personName={'Krish'} />, 

    "clue4" : <Clue4 />,
    "dhara": <Person4 textFileName={'dhara'} personName={'Dhara'} />, 

    "clue5" : <Clue5 />, 
    "sarjana": <Person5 textFileName={'sarjana'} personName={'Jiya'} />, 

    "clue6" : <Clue6 />, 
    "viha": <Person6 />, 

    "clue7" : <Clue7 />, 
    "riza": <Person7 />, 

    "clue8" : <Clue8 />, 
  }

  const routeList = [];

  routeList.push(
    <Route path="/" element={<Home />} />
  )
  let str = "/"
  Object.entries(mapRoutes).forEach(([clueName, listDetais], index) => {
    str += clueName + '/'
    routeList.push(
      <Route path={str} element={listDetais[0]} />
    )
  });
function App() {
  return (
      <BrowserRouter>
      <Routes>
        {routeList}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
